description:
For the first time in Wicked Pictures history, award-winning Director of the Year Brad Armstrong, and ALL of Wicked's stunning contract superstars come together in one incredible movie. Alektra, Jessica, Kaylani, Kirsten, Mikayla, and Stormy as you've never seen them before. The result is the HOUSE OF WICKED, an amazing combination of beauty, style, and raw sexual energy. With a backdrop of urban style, these ravishing beauties slide into their own brand of Wicked Couture, and work it for the cameras like, no one else can... Gothic, Club Wear, Asian Flair, Skater Chic, Cowgirl, Prep School, or Heavy Metal, each of which sets the stage for the Wicked girls to do what they do best, and they've never looked more amazing doing it. Once you've entered the HOUSE OF WICKED, you'll never want to leave! 

